import React from 'react';

const links = [
  { name: 'Home', path: '#home' },
  { name: 'Crypto Trend', path: '#crypto-trend' },
  { name: 'Video Gen', path: '#video-gen' },
  { name: 'Image Gen', path: '#image-gen' },
];

export default function Header() {
  return (
    <header className="sticky top-0 z-50 backdrop-blur-lg bg-black/30 border-b border-glassBorder shadow-md">
      <nav className="max-w-7xl mx-auto flex items-center justify-between p-5">
        <div className="flex items-center space-x-3 select-none">
          <img
            src="/trendAiLogo.png"
            alt="TrendAI Logo"
            className="h-10 w-auto rounded-md shadow-md"
            style={{ backgroundColor: 'rgba(10,10,10,0.6)' }}
          />
          <h1 className="text-2xl font-semibold tracking-wide text-cyan-400">TrendAI</h1>
        </div>
        <ul className="flex space-x-8 text-lg font-medium">
          {links.map(({ name, path }) => (
            <li key={path}>
              <a
                href={path}
                className="text-gray-400 hover:text-cyan-300 transition-colors duration-300"
              >
                {name}
              </a>
            </li>
          ))}
        </ul>
      </nav>
    </header>
  );
}
